mapper.select:

select 

from def_doc_partner_role
where DOC_TYPE = #{docType,jdbcType=VARCHAR}
  and ROLE = #{role,jdbcType=VARCHAR}
  and TYPE = #{type,jdbcType=VARCHAR}
  and VERSION = #{version,jdbcType=INTEGER}

mapper.delete:

delete from def_doc_partner_role
where DOC_TYPE = #{docType,jdbcType=VARCHAR}
  and ROLE = #{role,jdbcType=VARCHAR}
  and TYPE = #{type,jdbcType=VARCHAR}
  and VERSION = #{version,jdbcType=INTEGER}
